C. Disciplinary Action and Sanctions
To ensure deterrence, it is necessary to establish forms of disciplinary action and sanctions.
Disciplinary action and sanctions should be included in the company regulations and/or collective
labor agreement. The form of disciplinary action or penalty depends on factors such as:
i. The severity or frequency of the harassment;
ii. The wishes of the person who was harassed;
iii. The extent to which the harasser could have anticipated that such behavior was
unacceptable or unwanted;
iv. The level of remorse; and/or
v. Whether there have been any prior incidents or warnings.
Disciplinary action should be taken in response to:
i. Any employee who has retaliated against or victimized another employee who has made
a harassment allegation or who has served as a witness in a harassment investigation;
ii. Any employee who makes malicious or vexatious false accusations.
The penalty recommended should be proportional to the gravity of the harassment and consistent
within the enterprise. The types of penalties for harassment include:
i. Issuing a written warning or reprimand;
ii. Issuing a transfer or reassignment of duties to the perpetrator;
iii. Removal of management authority or duties;
iv. Reduction in wages;
v. In serious cases, suspending or terminating employment;
vi. Training or counseling of the harasser may be necessary to ensure that the harasser
understands why his or her conduct violated the enterprises harassment policy.
Continued monitoring of their conduct is also needed to ensure behavioral change.
